function Maze(props) {
//   const mazeMatrix = props.mazeMatrix;

    function TableCols(props){ 
        const cols = props.tr.map(
            (col) => 
            <td>
                {col} 
            </td>
        )
        return cols;
    }
    //Map each row to its corresponding HTML
    function TableRows(props){ 
        const rows = props.td.map(
            (row) => 
            <tr>
                <TableCols tr = {row}/> 
            </tr>
        )
        return rows;
    }

    return (
        <div>
            <h1 style={{ fontSize: '36px' }}>Maze Game</h1>
            <table>
                <TableRows td={props.td}/>
            </table>
        </div>
    );
}

export default Maze;
